import "./App.css";
import "./"

import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

import Home from "./components/routes/home/Home";
import React from "react";

function App() {
	return (
		<Router>
			<div className="App">
				<Routes>
					<Route path="/home" element={<Home />} />
				</Routes>
			</div>
		</Router>
	);
}

export default App;
